import React, { Component } from "react";
import { Breadcrumb } from "@gull";
import LineChart4 from "app/views/charts/echarts/LineChart4";
import DoughnutChart from "app/views/charts/echarts/Doughnut";
import {ProgressBar, Table} from "react-bootstrap";
import ReactPaginate from "react-paginate";
import SimpleCard from "@gull/components/cards/SimpleCard";
import { classList } from "@utils";
import {Link} from "react-router-dom";
import Chart from "react-apexcharts";

import {
  bAOptions18
} from "app/views/widgets/statisticsWidgetChartOptions";
import ReactEcharts from "echarts-for-react";
import {echartBasicDoughnutOption} from "../../charts/echarts/echartOptions";

class Project extends Component {
  state = {
    cardList: [
      {
        icon: "i-Add-User",
        title: "10",
        subtitle: "Tasks Created"
      },
      {
        icon: "i-Financial",
        title: "6",
        subtitle: "Tasks Approved"
      }
    ],
    topAuthorList: [
      {
        name: "David Hopkins",
        description: "Lorem ipsum dolor sit amet consectetur.",
        photoUrl: "/assets/images/faces/2.jpg"
      },
      {
        name: "James Mitchell",
        description: "Lorem ipsum dolor sit amet consectetur.",
        photoUrl: "/assets/images/faces/3.jpg"
      },
      {
        name: "Jessica Mitchell",
        description: "Lorem ipsum dolor sit amet consectetur.",
        photoUrl: "/assets/images/faces/4.jpg"
      }
    ],
    lastMonthSummery: [
      {
        name: "Portable Speaker",
        status: "+ $1200"
      },
      {
        name: "Portable Headphe",
        status: "In Stock"
      },
      {
        name: "Speaker",
        status: "Out of Stock"
      },
      {
        name: "Watch",
        status: "Low Stock"
      }
    ],
    newUserList: [
      {
        name: "David Hopkins",
        email: "hopkins@gmail.com",
        photoUrl: "/assets/images/faces/2.jpg",
        status: "active"
      },
      {
        name: "James Mitchell",
        email: "petter@gmail.com",
        photoUrl: "/assets/images/faces/3.jpg",
        status: "pending"
      },
      {
        name: "Jessica Mitchell",
        email: "johndoe@gmail.com",
        photoUrl: "/assets/images/faces/4.jpg",
        status: "inactive"
      }
    ],
    topProductList: [
      {
        name: "Watch",
        date: "12-10-2019",
        price: 30,
        status: "delivered"
      },
      {
        name: "Iphone",
        date: "24-10-2019",
        price: 350,
        status: "pending"
      },
      {
        name: "Headphone",
        date: "11-11-2019",
        price: 10,
        status: "not delivered"
      }
    ],
    chartList5: {
      title: "Item Pending",
      chart: bAOptions18
    }
  };

  handlePageClick = data => {
    let pageNumber = data.selected;
    let offset = Math.ceil(pageNumber * this.props.perPage);
    this.setState({ offset: offset }, () => {
      console.log(data);
    });
  };

  getUserStatusClass = status => {
    switch (status) {
      case "active":
        return "badge-success";
      case "delivered":
        return "badge-success";
      case "inactive":
        return "badge-warning";
      case "not delivered":
        return "badge-warning";
      case "pending":
        return "badge-primary";
      default:
        break;
    }
  };

  getStatusTextColor = status => {
    switch (status) {
      case "In Stock":
        return "text-success";
      case "Low Stock":
        return "text-warning";
      case "Out of Stock":
        return "text-danger";
      default:
        return "text-primary";
    }
  };

  render() {
    let {
      cardList = [],
      lastMonthSummery = [],
      topAuthorList = [],
      newUserList = [],
      topProductList = [],
      chartList5 = { }
    } = this.state;

    return (
      <div>
        <Breadcrumb
          routeSegments={[
            { name: "Project Dashboard" }
          ]}
        ></Breadcrumb>

        <div className="card mb-3">
          <div className="card-header">Project Name</div>
          <div className="card-body">
            <h5 className="card-title">Project Description</h5>
            <div className="row">
              <div className="row">
                <div className="col-md-3">
                  <div className="card mb-4">
                    <div className="card-body">
                      <h6 className="mb-2 text-muted">Storage Usage</h6>
                      <p className="mb-1 text-22 font-weight-light">50%</p>
                      <ProgressBar
                          variant="success"
                          now={50}
                          style={{ height: "4px" }}
                      ></ProgressBar>
                      <small className="text-muted">
                        Most data used in last 3 days
                      </small>
                    </div>
                  </div>
                </div>

                <div className="col-md-3">
                  <div className="card mb-4">
                    <div className="card-body">
                      <h6 className="mb-2 text-muted">Bandwith Usage</h6>
                      <p className="mb-1 text-22 font-weight-light">90%</p>
                      <ProgressBar
                          variant="danger"
                          now={90}
                          style={{ height: "4px" }}
                      ></ProgressBar>
                      <small className="text-muted">
                        Most data used in last 7 days
                      </small>
                    </div>
                  </div>
                </div>

                <div className="col-md-3">
                  <div className="card mb-4">
                    <div className="card-body">
                      <h6 className="mb-2 text-muted">Data Usage</h6>
                      <p className="mb-1 text-22 font-weight-light">60%</p>
                      <ProgressBar
                          variant="warning"
                          now={60}
                          style={{ height: "4px" }}
                      ></ProgressBar>
                      <small className="text-muted">
                        Most data used in last 5 days
                      </small>
                    </div>
                  </div>
                </div>

                <div className="col-md-3">
                  <div className="card mb-4">
                    <div className="card-body">
                      <h6 className="mb-2 text-muted">Data Usage</h6>
                      <p className="mb-1 text-22 font-weight-light">60%</p>
                      <ProgressBar
                          variant="info"
                          now={60}
                          style={{ height: "4px" }}
                      ></ProgressBar>
                      <small className="text-muted">
                        Most data used in last 4 days
                      </small>
                    </div>
                  </div>
                </div>
              </div>

              {cardList.map((card, index) => (
                  <div key={index} className="col-md-4">
                    <div className="card card-icon-big mb-4">
                      <div className="card-body text-center">
                        <i className={card.icon}></i>
                        <p className="text-muted mt-2 mb-0 text-capitalize">
                          {card.subtitle}
                        </p>
                        <p className="lead text-18 mt-2 mb-0 text-capitalize">
                          {card.title}
                        </p>
                      </div>
                    </div>
                  </div>
              ))}
              <div className="card mb-4">
                <div className="card-body">
                  <h6 className="mb-2 text-muted">Jobs Progress</h6>
                  <p className="mb-1 text-22 font-weight-light">40%</p>
                  <ProgressBar
                      variant="success"
                      now={40}
                      style={{ height: "4px" }}
                  ></ProgressBar>
                  <small className="text-muted">
                    Approved Jobs as per today
                  </small>
                </div>
              </div>
              <div className="card mb-4">
                <div className="card-body">
                  <h6 className="mb-2 text-muted">Tasks Progress</h6>
                  <p className="mb-1 text-22 font-weight-light">60%</p>
                  <ProgressBar
                      variant="success"
                      now={60}
                      style={{ height: "4px" }}
                  ></ProgressBar>
                  <small className="text-muted">
                    Approved Tasks as per today
                  </small>
                </div>
              </div>
            </div>
            <Link to="/" className="btn btn-primary btn-rounded">
              Go somewhere
            </Link>
          </div>
        </div>

        <div className="card mb-4">
          <div className="card-header">Project Name</div>
          <div className="card-body">
            <h5 className="card-title">Project Description</h5>
            <div className="row">
                  {cardList.map((card, index) => (
                      <div key={index} className="col-md-4">
                        <div className="card card-icon-big mb-4">
                          <div className="card-body text-center">
                            <i className={card.icon}></i>
                            <p className="text-muted mt-2 mb-0 text-capitalize">
                              {card.subtitle}
                            </p>
                            <p className="lead text-18 mt-2 mb-0 text-capitalize">
                              {card.title}
                            </p>
                          </div>
                        </div>
                      </div>
                  ))}
                  <div className="card mb-4">
                    <div className="card-body">
                      <h6 className="mb-2 text-muted">Jobs Progress</h6>
                      <p className="mb-1 text-22 font-weight-light">40%</p>
                      <ProgressBar
                          variant="success"
                          now={40}
                          style={{ height: "4px" }}
                      ></ProgressBar>
                      <small className="text-muted">
                        Approved Jobs as per today
                      </small>
                    </div>
                  </div>
                  <div className="card mb-4">
                    <div className="card-body">
                      <h6 className="mb-2 text-muted">Tasks Progress</h6>
                      <p className="mb-1 text-22 font-weight-light">60%</p>
                      <ProgressBar
                          variant="success"
                          now={60}
                          style={{ height: "4px" }}
                      ></ProgressBar>
                      <small className="text-muted">
                        Approved Tasks as per today
                      </small>
                    </div>
                  </div>
            </div>
            <Link to="/" className="btn btn-primary btn-rounded">
              Go somewhere
            </Link>
          </div>
        </div>

        <div className="card mb-4">
          <div className="card-header">Project Name</div>
          <div className="card-body">
            <h5 className="card-title">Project Description</h5>
            <div className="row">
              <div className="col-lg-6 col-md-12">
                <div className="row">
                  {cardList.map((card, index) => (
                      <div key={index} className="col-md-4">
                        <div className="card card-icon-big mb-4">
                          <div className="card-body text-center">
                            <i className={card.icon}></i>
                            <p className="text-muted mt-2 mb-0 text-capitalize">
                              {card.subtitle}
                            </p>
                            <p className="lead text-18 mt-2 mb-0 text-capitalize">
                              {card.title}
                            </p>
                          </div>
                        </div>
                      </div>
                  ))}

                  <div className="card mb-4">
                    <div className="card-body">
                      <h6 className="mb-2 text-muted">Jobs Progress</h6>
                      <p className="mb-1 text-22 font-weight-light">40%</p>
                      <ProgressBar
                          variant="success"
                          now={40}
                          style={{ height: "4px" }}
                      ></ProgressBar>
                      <small className="text-muted">
                        Approved Jobs as per today
                      </small>
                    </div>
                  </div>
                  <div className="card mb-4">
                    <div className="card-body">
                      <h6 className="mb-2 text-muted">Tasks Progress</h6>
                      <p className="mb-1 text-22 font-weight-light">60%</p>
                      <ProgressBar
                          variant="success"
                          now={60}
                          style={{ height: "4px" }}
                      ></ProgressBar>
                      <small className="text-muted">
                        Approved Tasks as per today
                      </small>
                    </div>
                  </div>

                </div>
              </div>
            </div>
            <div className="row">
              <Link to="/" className="btn btn-primary btn-rounded">
                Go somewhere
              </Link>
            </div>
          </div>

        </div>

        <div className="card mb-4">
          <div className="card-header">Featured</div>
          <div className="card-body">
            <h5 className="card-title">Card title text</h5>
            <p className="card-text">
              With supporting text below as a natural lead-in to
              additional content.
            </p>
            <div className="col-md-6">
              <DoughnutChart height="200px"></DoughnutChart>
            </div>
            <Link to="/" className="btn btn-primary btn-rounded">
              Go somewhere
            </Link>
          </div>
        </div>


      </div>
    );
  }
}

export default Project;
